import React from "react";
import styled from "styled-components";

const FindPassword = () => {
  return (
    <React.Fragment>
      <Wrap>
        <Text>비밀번호 찾기</Text>
      </Wrap>
    </React.Fragment>
  );
};
export default FindPassword;

const Wrap = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
`;

const Text = styled.div`
  font-family: "TTTogether";
  font-size: 1.62rem;
`;
